us in one location.'=>'Vaša tema može prikazati menije na jednoj lokaciji.','Your theme can display menus in %s location.'=>'Vaša tema može prikazati menije na %s lokaciji.' . "\0" . 'Vaša tema može prikazati menije na %s lokacije.' . "\0" . 'Vaša tema može prikazati menije na %s lokacija.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Ako vaša tema ima višestruke menije, dajući im jasna imena će vam pomoći u lakšem upravljanju menijima.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Ako vaša tema ima widgete, možete dodati i menije. Posjetite <a href="%s">Widget ploču</a> i dodajte &#8220;navigacioni meni za widgete&#8221;, kako biste prikazali meni u bočnoj traci ili podnožju.','New Menu'=>'Novi meni','Create New Menu'=>'Kreiraj novi meni','Name for the Visual editor tabVisual'=>'Vizualno','The theme defines itself as its parent theme. Please check the %s header.'=>'Tema se definiše kao matična tema. Molim provjerite %s zaglavlje.','Usage of user levels is deprecated. Use capabilities instead.'=>'Korištenje korisničkih nivoa je zastarjelo. Koristite sposobnosti umjesto toga.','Date'=>'Datum','Month'=>'Mjesec','Day'=>'Dan','Time'=>'Vrijeme','Hour'=>'Sat','Minute'=>'Minuta','Meridian'=>'Meridijan','%1$s-%2$s'=>'%1$s-%2$s','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Kliknite &#8220;Dodaj novu sliku&#8221; kako biste prenijeli sliku sa svog računara. Vaša tema funkcionira najbolje sa slikom koja odgovara veličini vašeg videa &#8212; moći ćete izrezati sliku na savršenu veličinu nakon što je prenesete.','Click &#8220;Add new image&#8221; to upload an image file from your computer. Your 